// src/pages/Dashboard.js
import React, { useEffect, useState } from 'react';
import API from '../api';

const Dashboard = () => {
  const [posts, setPosts] = useState([]);

  useEffect(() => {
    const fetchPosts = async () => {
      try {
        const token = localStorage.getItem('token');
        const { data } = await API.get('/posts', {
          headers: { Authorization: `Bearer ${token}` },
        });
        setPosts(data);
      } catch (error) {
        console.error('Error fetching posts:', error);
      }
    };
    fetchPosts();
  }, []);

  return (
    <div>
      <h1>Your Dashboard</h1>
      <div>
        <h2>Recent Posts</h2>
        {posts.length > 0 ? (
          posts.map((post) => (
            <div key={post._id}>
              <h3>{post.title}</h3>
              <p>Language: {post.language}</p>

              {/* Download link for the code file */}
              {post.codeFileUrl && (
                <p>
                  Code Snippet File:{' '}
                  <a href={post.codeFileUrl} download>
                    Download Code
                  </a>
                </p>
              )}

              {/* Download link for the uploaded file */}
              {post.uploadedFileUrl && (
                <p>
                  Uploaded File:{' '}
                  <a href={post.uploadedFileUrl} download>
                    Download File
                  </a>
                </p>
              )}
            </div>
          ))
        ) : (
          <p>No posts available</p>
        )}
      </div>
    </div>
  );
};

export default Dashboard;
